import React, { useState } from "react";
import MapContainer2 from "./MapContainer2";

const SearchHealingPlace = () => {
  const [place, setPlace] = useState("공원");
  const [selected, setSelected] = useState("공원");
  const onChange = (e) => {
    setPlace(e.target.value);
    setSelected(e.target.value);
  };

  return (
    <>
      <MapContainer2 searchPlace={place} />
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="공원"
        checked={selected == "공원"}
      />
      공원
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="맛집"
        checked={selected == "맛집"}
      />
      맛집
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="카페"
        checked={selected == "카페"}
      />
      카페
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="도서관"
        checked={selected == "도서관"}
      />
      도서관
    </>
  );
};

export default SearchHealingPlace;
